" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Distal clavicle fracture type III",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 418px; height: 383px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This picture depicts a type III distal clavicle fracture, involving only the articular surface of the acromioclavicular joint. No ligamentous disruption or displacement occurs. These fractures present as late degenerative changes of the joint.",
"    <div class=\"footnotes\">",
"    </div>",
