"     Reproduced with permission from: Rockwood CA Jr, Green DP, Bucholz RW, Heckman JD (Eds). Rockwood and Green's Fractures in Adults, 4th ed, Lippincott-Raven, Philadelphia 1996. Copyright &copy; 1996 Lippincott Williams &amp; Wilkins.",
