var title_f15_41_16023="Apical 4 chamber color flow Doppler MR II";
var content_f15_41_16023=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F55534%7ECARD%2F77039&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F55534%7ECARD%2F77039&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Apical four chamber view showing color flow Doppler of mitral regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 286px; height: 460px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A is an apical four chamber view in systole showing color jets of mild mitral regurgitation (MR) and mild tricuspid regurgitation (TR). The jets are central and do not penetrate the left atrium (LA) on right atrium (RA) beyond the mid cavity. Panel B shows an apical four chamber view in patients with severe MR; the arrows outline the course of a jet during systole that adheres to and follows the contour of the LA. Such wall hugging jets are typical of severe regurgitation. Since their area is smaller than central jets, the use of wall hugging jet area as a sign of MR severity is not recommended.",
"    <div class=\"footnotes\">",
"     LV: left ventricle; RA: right atrium; RV: right ventricle.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Color flow Doppler of severe mitral regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 364px; height: 277px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The color flow Doppler signal, as seen in the four chamber view, shows the typical features of severe mitral regurgitation; the first is a large proximal isovelocity surface area (PISA) and the second is a broad crossing jet from left ventricle (LV) into the left atrium (LA).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
