var title_f15_41_16027="Questionnaire for diagnosis SLE";
var content_f15_41_16027=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F51827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F51827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Questionnaire for the diagnosis of systemic lupus erythematosus",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Have you ever had arthritis or rheumatism for more than 3 months?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Do your fingers become pale, numb, or uncomfortable in the cold?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Have you had any sores in your mouth for more than 2 weeks?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Have you been told that you have low blood counts (anemia, low WBC count, or low platelet count)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Have you ever had a prominent rash on your cheeks for more than 1 month?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Does your skin break out after you have been in the sun (not sunburn)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Has it ever been painful to take a deep breath for more than a few days (pleurisy)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Have you ever been told that you have protein in your urine?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Have you ever had rapid loss of lots of hair?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Have you ever had a seizure, convulsion, or fit?",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
