var title_f15_41_16028="Indications for speech and language evaluation";
var content_f15_41_16028=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F75364&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F75364&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications for speech and language evaluation in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Concern by the parent, teacher, professional, or other caregiver about the child's speech or language",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Slowed or stagnant speech and language development",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Excessive drooling",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Difficulty sucking, chewing, or swallowing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Difficulty coordinating movements of lips, tongue, and jaw",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No babbling by 9 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No first words by 15 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No consistent words by 18 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No word combinations by 24 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Speech is difficult for parents to understand at 24 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Speech is difficult for strangers to understand at 36 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dysfluencies (stutters) consist of more than tension-free whole-word repetitions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Child is frustrated by communication difficulty",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Child is teased by peers for \"talking funny\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Child avoids talking situations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Child acquires vocabulary and sentence structure but does not use language appropriately for communicative purposes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Language is unusual or confused, or ideas are not expressed clearly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Child cannot follow instructions without supplemental visual cues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Loss of milestones",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Poor memory skills at 5 to 6 years",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Flax JF, Rapin I. Evaluating children with delayed speech and language. Contemp Pediatr 1998; 15:164.",
"       </li>",
"       <li>",
"        Sturner RA, Howard BJ. Preschool development. 1: Communicative and motor aspects. Pediatr Rev 1997; 18:291.",
"       </li>",
"       <li>",
"        Johnson CP, Blasco PA. Infant growth and development. Pediatr Rev 1997; 18:224.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
